import React from 'react';

import ListMessages from '../components/ListMessages'
import FormMessages from '../components/FormMessages'

const Messages = () => {
  return <>
        <div>
            <FormMessages />
            <ListMessages />
        </div>
  </>;
};

export default Messages;
